import React from 'react';
import Paper from '@material-ui/core/Paper';
import { makeStyles } from '@material-ui/core/styles';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import PeopleIcon from '@material-ui/icons/People';
import PersonPinIcon from '@material-ui/icons/PersonPin';
import StayPrimaryPortraitIcon from '@material-ui/icons/StayPrimaryPortrait';
import './TabbedContent.css';

const useStyles = makeStyles({
  root: {
    flexGrow: 1,
    maxWidth: 500,
  },
});

export default function TabbedContent() {
  const classes = useStyles();
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <Paper square className="tabbedContent">
      <Tabs
        value={value}
        onChange={handleChange}
        variant="fullWidth"
        indicatorColor="secondary"
        textColor="secondary"
        aria-label="icon label tabs example"
      >
        <Tab icon={<StayPrimaryPortraitIcon />} label="Primary" />
        <Tab icon={<PeopleIcon />} label="Socials" />
        <Tab icon={<PersonPinIcon />} label="Promotions" />
      </Tabs>
    </Paper>
  );
}
